      <article className="menu-item">
        {products.map(product =>(
          <>
 <img src={product.img} className="photo" />
        <div className="item-info">
          <header>
            <h4>{product.title}</h4>
            <h4 className="price">{product.price}</h4>
          </header>
          <p className="item-text">{product.desc}</p>
        </div>
          </>
        ))}
        </article>


    </div>
  );
};

